        "partnerTopicDetails": {
          "description": "Auth0, the identity platform for application builders, provides developers and enterprises with the building blocks they need to secure their applications.",
          "longDescription": "Partnering with Event Grid allows our customers to leverage events emitted by Auth0’s system to accomplish a number of use cases, from engaging with users in meaningful and custom ways after the authentication to automating security and infrastructure tasks.\nThe Auth0 Partner Topic integration allows you to stream your Auth0 log events with high reliability into Azure for consumption with any of your favorite Azure resources. This will allow you to react to events, gain insights, monitor for security issues, and interact with other powerful data pipelines. In order to create an Auth0 Partner topic:\n1. Note the Azure Subscription and Resource Group you want the Partner Topic to be created in.\n2.Log in to your Auth0 account dashboard.\n3.Navigate to Logs > Streams, click “Create Stream” and select the “Azure Event Grid” event stream.\n4. Provide the Azure Subscription ID, Resource Group and other required information and click “Save”.\n5. View your pending Partner Topics in Azure and activate the topic to allow events to flow.",
